import React from "react";
import ReactDOM from "react-dom";
import useFetch from "./useFetch";

const Webcams = ( { parkCode } ) => {
    const { data: webcam, isPending, error } = useFetch('https://developer.nps.gov/api/v1/webcams?parkCode='+parkCode+'&limit=1000&api_key=gUeSemHr93mXuKE5WqakVIaO2cDN67aqXettWyDE');
    //console.log(parks);
    //const parks = data;
    //const [Activities, setActivities] = useState([]);

    /*const handleActivitySearch = (activity) => {
        const newParks = parks.filter(park => park.activities !== activity);
        setParks(newParks);
    }*/

    return (  
        <div className="ParksList">
        <h2>All Parks</h2>
            { error && <div>{ error }</div> }
            { isPending && <div>Loading...</div> }
            { webcam && (
                webcam.data.map((image)=>(
                        <div>
                        <img 
                        src={image.url}
                        alt="new"
                        />
                        </div>
                ))
            )}
        </div>
    );
}

export default Webcams;
